1281=Atidaryti svetainę naujame skirtuke automatiškai
1282=Pagal numatymą, „Slimjet“ atidaro svetainę dabartiniame skirtuke, kai įvedate URL iš omnibox arba paspaudus žymę. Jūs galite laikyti nuspaudę ALT klavišą, kad atidaryti svetainę naujame skirtuke. Jei norite atidaryti svetainę naujame skirtuke pagal numatymą, įjunkite parinktį "Auto sukurti naują skirtuką, kai URL yra įvestas" skiltyje "Skirtuko parinktys" nustatymų puslapyje. Kai ši parinktis įjungta, galite laikyti ALT klavišą, kad atidaryti svetainę dabartiniame skirtuke.
